"""
Given an array of n integers nums, a 132 pattern is a subsequence of three integers nums[i], nums[j] and nums[k] such that i < j < k and nums[i] < nums[k] < nums[j].

Return true if there is a 132 pattern in nums, otherwise, return false.

Example 1:

Input: nums = [1,2,3,4]
Output: false
Explanation: There is no 132 pattern in the sequence.

Example 2:

Input: nums = [3,1,4,2]
Output: true
Explanation: There is a 132 pattern in the sequence: [1, 4, 2].

Example 3:

Input: nums = [-1,3,2,0]
Output: true
Explanation: There are three 132 patterns in the sequence: [-1, 3, 2], [-1, 3, 0] and [-1, 2, 0].

Constraints:

	n == nums.length
	1 <= n <= 2 * 105
	-109 <= nums[i] <= 109
"""
import sys
from typing import List
import pytest


class Solution:
    def find132pattern(self, nums: List[int]) -> bool:
        """05/03/2020 23:23"""
        if len(nums) < 3:
            return False

        min_from_left = [nums[0]]
        for i in range(1, len(nums)):
            min_from_left.append(min(min_from_left[-1], nums[i]))

        stack = [nums[-1]]
        for i in range(len(nums) - 2, 0, -1):
            if stack and nums[i] > stack[-1]:
                while stack:
                    n = stack.pop()
                    if min_from_left[i] < n < nums[i]:
                        return True
                    if not stack or stack[-1] > nums[i]:
                        break
            if not stack or nums[i] < stack[-1]:
                stack.append(nums[i])
        return False

    def find132pattern(self, nums: List[int]) -> bool:
        """05/20/2022 12:10
        The first number needs to be smaller than the third number. Thus, the
        thrid number is larger the easier to find such the first number. When
        we iterate from the back, we want to find the largest smaller number
        which appeared ahead. To do that, keep a stack in decreasing order by
        popping out all smaller number and add the current number.
        """
        stack = [nums[-1]]
        lower_bound = -float('inf')
        for i in range(len(nums)-2, -1, -1):
            if nums[i] < lower_bound:
                return True
            while stack and stack[-1] < nums[i]:
                lower_bound = stack.pop()
            stack.append(nums[i])
        return False


